int main() {

	int x, y;

		// make all white
	for (x = 0; x < xn; x++)
	for (y = 0; y < yn; y++) {
	  fbp->pixels[y][x] = 0x0000;
	  }
		//Outer Background
	solid_color(fbp, 0xffff); // make all pixels white
	
	if (startPage) drawStartPage(fbp);
	if (gameWon) drawWinPage(fbp);
  

}
